import './App.css';
import Body from './Body/Body';
import ResultModal from './Body/ModalBox/ResultModal';
import StartModal from './Body/ModalBox/StartModal';
import Heading from './Heading/Heading';

function App() {

  const [value, setValue] = useState();
  const [endValue, setEndValue] = useState();

  const StartclickHandler = (val) => {
      setValue(val);
  }

  return (
    <div className="App">

      {!value && <StartModal
      title="Hello There"
      onClick={StartclickHandler}/>}
      {<ResultModal
      />}
      <Heading/>
      <Body/>
    </div>
  );
}

export default App;
